INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (1, 36, 1, 'The hostal was absolutely fantastic! It was clean, well-maintained, and had a beautiful view of the surrounding area. The staff were incredibly friendly and made our stay very enjoyable. I would highly recommend this place to anyone looking for a great getaway.', '5');
INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (2, 68, 2, 'Our experience at the hostal was below our expectations. The room was not clean, and the service was lacking. We were quite disappointed with our stay.', '2');
INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (3, 47, 3, 'Our stay at the hostal was nothing short of amazing. The location was perfect, and the facilities were top-notch. We had a wonderful time exploring the area and would definitely return.', '4');
