INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (5, 54, 5, 'We had a fantastic experience at the hostal. The room was spacious and comfortable, and the staff went above and beyond to make us feel welcome. The food at the on-site restaurant was delicious. We give it a solid 5-star rating.', '5');
INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (6, 96, 6, 'Our stay at the hostal was delightful. The room was cozy, and the atmosphere was peaceful. We enjoyed every moment of our stay and would definitely visit again.', '5');
INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (7, 95, 7, 'The hostal had a stunning location, and we enjoyed the beautiful views. The staff were friendly and accommodating. Our stay was truly memorable.', '4');
INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (8, 17, 8, 'We had a great time at the hostal. The room was comfortable, and the service was excellent. The hostal had a relaxed and friendly atmosphere. We would return without hesitation.', '5');
INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (9, 27, 9, 'Our stay at the hostal was wonderful. The room was clean and well-maintained, and the staff were friendly and helpful. We explored the local area and had a great time.', '3');
INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (10, 50, 10, 'The hostal exceeded our expectations. The room was spacious, and the view from our balcony was breathtaking. We enjoyed the local attractions and had an unforgettable experience.', '4');
INSERT INTO `inf2003`.`review_hostel` (`review_hostel_id`, `user_id`, `booking_hostel_id`, `review_comment`, `review_rating`) VALUES (11, 80, 11, 'We had a pleasant stay at the hostal. The room was clean and comfortable, and the staff were courteous. The hostal\'s location allowed us to explore the area easily, and we had a good time.', '4');
